import React from 'react';

const SleepData = props => {
    return (
        <div>
            <table>
                <thead>
                    <tr>
                        <th>Date</th>
                        <th>Duration</th>
                        <th>Score</th>
                        <th>Bedtime</th>
                    </tr>
                </thead>
                <tbody>
                    {props.sleepEntries.map(i => (
                        <tr key={i.date}>
                            <td>{i.duration}</td>
                        </tr>

                    ))}
                </tbody>
            </table>

        </div>
    )
}

export default SleepData;
